let mock = [
{
  id: 1,
  title: "First Entry",
  text: "I got engaged today! We went on a hike up Provo canyon in the snow and brought stuff to make hot chocolate I could tell he was nervouse and I guessed what was coming. We hiked to the top of the hill and he proposed! So excited!",
  date: "1/11/2021",
  image: "https://i.pinimg.com/originals/92/a1/2c/92a12cb7b21d8e61471ed9a12ba6715d.jpg",
},
{
  id: 2,
  title: "Wedding Planning",
  text: "Today we looked at a venue for the wedding and I think we found the one! It's right next to where Bryan proposed and it has a beautiful outside area.",
  date: "1/16/2021",
  image: "https://www.orem.us/uploads/7/8/6/6/7866822/223849.jpg?504",
},
{
  id: 3,
  title: "School",
  text: "I spent all day doing homework. I'm only taking 12 credits this semester but school feels way more difficult than it has in the past. I hope I can stay on top of my assignments.",
  date: "1/24/2021",
  image: "https://norsecorp.com/wp-content/uploads/2019/05/eng.jpg",
},
{
  id: 4,
  title: "School update",
  text: "Not staying on top of my assignments :(",
  date: "2/2/2021",
  image: "https://i.pinimg.com/originals/76/ed/58/76ed58cd22f4838602113cfabe255319.jpg",
},
{
  id: 5,
  title: "Florida",
  text: "I went to Florida with my mom and it was beautiful and so warm! Definitely got a sunburn and I found so many cool shells to take home with me! I really dont' wanna go home.",
  date: "2/3/2021",
  image: "https://assets.gojourny.com/uploads/images/attachments/ea382656-85a0-4c7e-9a21-0dd05dee83e0.jpg",
},
{
  id: 6,
  title: "Dress",
  text: "I found a wedding dress! It was at the first place we looked at and it's the same one from my pinterest board! Kinda funny huh?",
  date: "2/12/2021",
  image: "https://i.pinimg.com/736x/b8/82/70/b88270541fd1d7f4275ce4c89cf2d1ba--flowy-wedding-dress-with-sleeves-wedding-dresses-flowy.jpg",
},
{
  id: 7,
  title: "Friends",
  text: "Some old friends were in town this weekend and we played games and got food. Really good to see them.",
  date: "2/17/2021",
  image: "https://i.pinimg.com/originals/85/90/2a/85902a06e7b751c44668eb3acf3dcc54.jpg",
},
{
  id: 8,
  title: "Cold",
  text: "It was so cold today I almost froze walking to campus. Spring can't come soon enough",
  date: "2/20/20201",
  image: "https://www.abc4.com/wp-content/uploads/sites/4/2021/02/snowy-neighborhood.jpg?w=900",
},
{
  id: 9,
  title: "Grateful",
  text: "I felt really grateful for the world today. It's so beautiful",
  date: "3/2/2021",
  image: "https://img5.onthesnow.com/image/xl/11/1186.jpg",
},
{
  id: 10,
  title: "Warm",
  text: "Went to Arizona to see Bryan's family and we hiked in Sedona. So nice to escape the cold and meet my soon-to-be family!",
  date: "3/16/2021",
  image: "https://cdn1.matadornetwork.com/blogs/1/2011/05/Arizona-1200x853.jpg",
},
